    and Management Options covers the hydrogeomorphic analysis (HGM) for Cokeville Meadows
    National Wildlife Refuge.  This three step process outlines the historical landscape,
    contemporary changes from pre-settlement conditions, restoration and management
    options and monitoring and evaluation needs for the Cokeville Meadows Area along
    the Bear River. Topics include geomorphology, soils, topography/elevation, climate,
